 Services. We may also collect your location (IP address) so that we can personalize our Services. For additional information, and to learn how to manage the technologies we utilize, please visit our \u003ca\u003eCookie Policy\u003c/a\u003e. If you wish to opt out of interest-based advertising click here [or if located in the European Union click here]. Please note you will continue to receive generic ads.","PrivacyPolicy.p6":"\u003cstrong\u003eSupplemented Data\u003c/strong\u003e may be received about you from other sources, including publicly available databases or third parties from whom we have purchased data, in which case we may combine this data with information we already have about you so that we can update, expand and analyze the accuracy of our records, assess the qualifications of a candidate for employment, identify new customers, and provide products and services that may be of interest to you. If you provide us personal information about others, or if others give us your information, we will only use that information for the specific reason for which it was provided to us.","PrivacyPolicy.p7":"\u003cstrong\u003eHow we utilize information.\u003c/strong\u003e We strongly believe in both minimizing the data we collect and limiting its use and purpose to only that (1) for which we have been given permission, (2) as necessary to deliver the Services you purchase or interact with, or (3) as we might be required or permitted for legal compliance or other lawful purposes:","PrivacyPolicy.p8":"\u003cstrong\u003eDelivering, improving, updating and enhancing our Services.\u003c/strong\u003e We collect various information relating to your purchase, use and/or interactions with our Services. We utilize this information to: \u003cul\u003e\u003cli\u003eImprove and optimize the operation and performance of our Services (again, including our websites and mobile applications)\u003c/li\u003e\u003cli\u003eDiagnose problems with and identify any security risks, errors, or needed enhancements to the Services\u003c/li\u003e\u003cli\u003eDetect and prevent fraud and abuse of our Services and systems\u003c/li\u003e\u003cli\u003eCollecting aggregate statistics about use of the Services\u003c/li\u003e\u003cli\u003eUnderstand and analyze how you use our Services and what products and services are most relevant to you.\u003c/li\u003e\u003c/ul\u003e","PrivacyPolicy.p9":"Much of the data collected is aggregated or statistical data about how individuals use our Services, and is not linked to any personal information.","PrivacyPolicy.p10":"\u003cstrong\u003eSharing with trusted third parties.\u003c/strong\u003e We may share your personal information with affiliated companies within our corporate family, with third parties with which we have partnered to allow you to integrate their services into our own Services, and with trusted third party service providers as necessary for them to perform services on our behalf, such as:\u003cul\u003e\u003cli\u003eProcessing credit card payments\u003c/li\u003e\u003cli\u003eServing advertisements\u003c/li\u003e\u003cli\u003eConducting contests or surveys\u003c/li\u003e\u003cli\u003ePerforming analysis of our Services and customers demographics\u003c/li\u003e\u003cli\u003eCommunicating with you, such as by way email or survey delivery\u003c/li\u003e\u003cli\u003eCustomer relationship management\u003c/li\u003e\u003cli\u003eRecruiting support and related services.\u003c/li\u003e\u003c/ul\u003e","PrivacyPolicy.p11":"We only share your personal information as necessary for any third party to provide the services as requested or as needed on our behalf. These third parties (and any subcontractors they may be permitted to use) are subject to strict data processing terms and conditions and are prohibited from utilizing, sharing or retaining your personal information for any purpose other than as they have been specifically contracted for (or without your consent).","PrivacyPolicy.p12":"We may also share your information with third parties for the purpose of facilitating / allowing a merger, acquisition or sale of all or substantially all of our assets, in which case the acquiring company may continue to utilize your data in the manner for which it was provided and intended.","PrivacyPolicy.p13":"\u003cstrong\u003eCommunicating with you.\u003c/strong\u003e We may contact you directly or through a third party service provider regarding products or services you have signed up or purchased from us, such as necessary to deliver transactional or service related communications. We may also contact you with offers for additional services we think youâ€™ll find valuable if you give us consent, or where allowed based upon legitimate interests. You donâ€™t need to provide consent as a condition to purchase our goods or services. These contacts may include:\u003cul\u003e\u003cli\u003eEmail\u003c/li\u003e\u003cli\u003eText (SMS) messages\u003c/li\u003e\u003cli\u003eTelephone calls\u003c/li\u003e\u003cli\u003eMessenger applications (e.g. WhatsApp, etc.)\u003c/li\u003e\u003cli\u003eAutomated phone calls or text messages.\u003c/li\u003e\u003c/ul\u003e","PrivacyPolicy.p14":"You may also update your subscription preferences with respect to receiving communications from us and/or our partners by signing into your account and visiting â€œAccount Settingsâ€ page.","PrivacyPolicy.p15":"If we collect information from you in connection with a co-branded offer, it will be clear at the point of collection who is collecting the information and whose privacy policy applies. In addition, it will describe any choice options you have in regards to the use and/or sharing of your personal information with a co-branded partner, as well as how to exercise those options. We are not responsible for the privacy practices or the content of third-party sites. Please read the privacy policy of any website you visit.","PrivacyPolicy.p16":"If you make use of a service that allows you to import contacts (ex. using email marketing services to send emails on your behalf), we will only use the contacts and any other personal information for the requested service. If you believe that anyone has provided us with your personal information and you would like to request that it be removed from our database, please contact us at \u003ca\u003eprivacy@afternic.com\u003c/a\u003e","PrivacyPolicy.p17":"\u003cstrong\u003eTransfer of personal information abroad.\u003c/strong\u003e If you utilize our Services from a country other than the country where our servers are located, your personal information may be transferred across international borders, which will only be done when necessary for the performance of our contract with you, when we have your consent to do so, or when the appropriate standard contractual clauses are in place. Also, when you call us or initiate a chat, we may provide you with support from one of our global locations outside your country of origin.","PrivacyPolicy.p18":"\u003cstrong\u003eCompliance with legal, regulatory and law enforcement requests.\u003c/strong\u003e We cooperate with government and law enforcement officials and private parties to enforce and comply with the law. We will disclose any information about you to government or law enforcement officials or private parties as we, in our sole discretion, believe necessary or appropriate to respond to claims and legal process (such as subpoena requests), to protect our property and rights or the property and rights of a third party, to protect the safety of the public or any person, or to prevent or stop activity we consider to be illegal or unethical.","PrivacyPolicy.p19":"To the extent we are legally permitted to do so, we will take reasonable steps to notify you in the event that we are required to provide your personal information to third parties as part of legal process. We will also share your information to the extent necessary to comply with any ICANN, registry or ccTLD rules, regulations and policies when you register a domain name with us. For reasons critical to maintaining the security, stability and resiliency of the Internet, this includes the transfer of domain name registration information to the underlying domain registry operator and escrow provider, and publication of that information as required by ICANN in the public WHOIS database or with other third parties that demonstrate a legitimate legal interest to such information.","PrivacyPolicy.p20":"\u003cstrong\u003eHow we secure, store and retain your data.\u003c/strong\u003e We follow generally accepted standards to store and protect the personal information we collect, both during transmission and once received and stored, including utilization of encryption where appropriate.","PrivacyPolicy.p21":"We retain personal information only for as long as necessary to provide the Services you have requested and thereafter for a variety of legitimate legal or business purposes. These might include retention periods:\u003cul\u003e\u003cli\u003emandated by law, contract or similar obligations applicable to our business operations;\u003c/li\u003e\u003cli\u003efor preserving, resolving, defending or enforcing our legal/contractual rights; or\u003c/li\u003e\u003cli\u003eneeded to maintain adequate and accurate business and financial records.\u003c/li\u003e\u003c/ul\u003e","PrivacyPolicy.p22":"If you have any questions about the security or retention of your personal information, you can contact us at \u003ca\u003eprivacy@afternic.com\u003c/a\u003e.","PrivacyPolicy.p23":"\u003cstrong\u003eHow you can access, update or delete your data.\u003c/strong\u003e To easily access, view, update, delete or port your personal information, or to update your subscription preferences, please sign into your Account and visit â€œAccount Settings.â€","PrivacyPolicy.p24":"If you make a request to delete your personal information and that data is necessary for the products or services you have purchased, the request will be honored only to the extent it is no longer necessary for any Services purchased or required for our legitimate business purposes or legal or contractual record keeping requirements. If you are unable for any reason to access your Account Settings, you may also contact us by one of the methods described in the â€œContact Usâ€ section below.","PrivacyPolicy.TRUSTe":"The E.U-U.S and Swiss-U.S. Privacy Shield Frameworks.","PrivacyPolicy.p25":"Our parent company, GoDaddy Operating Company, LLC (and our related entities, including GoDaddy.com, LLC, Blue Razor Domains, LLC, Starfield Technologies, LLC, Domains by Proxy, LLC, Outright, Inc., Mad Mimi, Inc. and Media Temple, Inc.) participates in and has certified its compliance with the EU-U.S. and Swiss-U.S. Privacy Shield Framework. GoDaddy Operating Company, LLC is committed to subjecting all personal information received from the EU or Switzerland, in reliance on the Privacy Shield Framework, to the Frameworkâ€™s applicable Principles. To learn more about the Privacy Shield Framework, visit the U.S. Department of Commerceâ€™s Privacy Shield List. Afternic is responsible for the processing of personal information it receives, under each Privacy Shield Framework, and subsequently transfers to a third party acting as an agent on its behalf. Afternic complies with the Privacy Shield Principles for all onward transfers of personal information from the EU and Switzerland, including the onward transfer liability provisions.","PrivacyPolicy.p26":"With respect to personal information received or transferred pursuant to each Privacy Shield Framework, Afternic is subject to the regulatory enforcement powers of the U.S. Federal Trade Commission. In certain situations, Afternic may be required to disclose personal information in response to lawful requests by public authorities, including to meet national security or law enforcement requirements.","PrivacyPolicy.p27":"If you have an unresolved privacy or data use concern that we have not addressed satisfactorily, please contact our U.S.-based third party dispute resolution provider (free of charge) at https://feedback-form.truste.com/watchdog/request. Under certain conditions, more fully described on the \u003ca\u003ePrivacy Shield website\u003c/a\u003e, you may invoke binding arbitration when other dispute resolution procedures have been exhausted.","PrivacyPolicy.p28":"In compliance with the Privacy Shield Principles, Afternic commits to resolve complaints about our collection or use of your personal information. EU and Swiss individuals with inquiries or complaints regarding our Privacy Shield policy should first contact us in any manner provided in the \"CONTACT US\" section below in this Privacy Policy.","PrivacyPolicy.p29":"Afternic has further committed to cooperate with the panel established by the EU data protection authorities (DPAs) and the Swiss Federal Data Protection and Information Commissioner (FDPIC) with regard to unresolved Privacy Shield complaints concerning human resources data transferred from the EU and Switzerland in the context of the employment relationship.","PrivacyPolicy.p30":"\u003cstrong\u003eâ€˜Do Not Trackâ€™ notifications.\u003c/strong\u003e Some browsers allow you to automatically notify websites you visit not to track you using a â€œDo Not Trackâ€ signal. There is no consensus among industry participants as to what â€œDo Not Trackâ€ means in this context. Like many websites and online services, we currently do not alter our practices when we receive a â€œDo Not Trackâ€ signal from a visitorâ€™s browser. To find out more about â€œDo Not Track,â€ you may wish to visit \u003ca\u003ewww.allaboutdnt.com\u003c/a\u003e.","PrivacyPolicy.p31":"\u003cstrong\u003eAge restrictions.\u003c/strong\u003e Our Services are available for purchase only for those over the age of 18. Our Services are not targeted to, intended to be consumed by or designed to entice individuals under the age of 18. If you know of or have reason to believe anyone under the age of 18 has provided us with any personal information, please contact us.","PrivacyPolicy.p32":"\u003cstrong\u003eNon-Discrimination.\u003c/strong\u003e We will not discriminate against you for exercising any of your privacy rights. Unless permitted under applicable laws, we will not:\u003cul\u003e\u003cli\u003eDeny you goods or services.\u003c/li\u003e\u003cli\u003eCharge you different prices or rates for goods or services, including through granting discounts or other benefits, or imposing penalties.\u003c/li\u003e\u003cli\u003eProvide you a different level or quality of goods or services.\u003c/li\u003e\u003cli\u003eSuggest that you may receive a different price or rate for goods or services or a different level or quality of goods or services.\u003c/li\u003e\u003c/ul\u003e","PrivacyPolicy.p33":"\u003cstrong\u003eChanges to this policy.\u003c/strong\u003e We reserve the right to modify this Privacy Policy at any time. If we decide to change our Privacy Policy, we will post those changes to this Privacy Policy and any other places we deem appropriate, so that you are aware of what information we collect, how we use it, and under what circumstances, if any, we disclose it. If we make material changes to this Privacy Policy, we will notify you here, by email, or by means of a notice on our home page, at least thirty (30) days prior to the implementation of the changes.","PrivacyPolicy.p34":"\u003cstrong\u003eData Protection Authority.\u003c/strong\u003e If you are a resident of the European Economic Area (EEA) and believe we maintain your personal information subject to the General Data Protection Regulation (GDPR), you may direct questions or complaints to your local supervisory authority or our lead supervisory authority, the UK's Information Commissionerâ€™s Office, as noted below:","PrivacyPolicy.p35":"www.ico.org.uk Information Commissionerâ€™s Office Wycliffe House, Water Lane, Wilmslow, Cheshire, SK9 5AF, United Kingdom Phone: 0303 123 1113","PrivacyPolicy.p36":"\u003cstrong\u003eContact us.\u003c/strong\u003e If you have any privacy-related questions, concerns or complaints about our Privacy Policy, our practices or our Services, you may contact our Office of the DPO by email at \u003ca\u003eprivacy@afternic.com\u003c/a\u003e. In the alternative, you may contact us by either of the following means:\u003cul\u003e\u003cli\u003eBy Mail: Attn: Office of the Data Protection Officer, 14455 North Hayden Road, Suite 219, Scottsdale, AZ 85260 USA, or for customers established in the EEA, Attn: Legal, Office of the DPO, 5th Floor, The Shipping Building, Old Vinyl Factory, 252-254 Blyth Road, Hayes, UB3 1HA.\u003c/li\u003e\u003cli\u003eBy Phone: (480) 505-8877\u003c/li\u003e\u003c/ul\u003e\u003cstrong\u003eWe will respond to all requests, inquiries or concerns within thirty (30) days.\u003c/strong\u003e","ContactForm.CookiePolicy":"Do not sell my personal information","CookiePolicy.title":"Cookie Policy","CookiePolicy.header":"\u003cstrong\u003eOUR USE OF COOKIES, WEB BEACONS, AND SIMILAR TECHNOLOGIES\u003c/strong\u003e","CookiePolicy.p1":"First and foremost, \u003cstrong\u003ewe DO NOT sell your personal information.\u003c/strong\u003e However, when you visit or interact with our sites, services, applications, tools or messaging, we or our authorized service providers may use cookies, web beacons, and other similar technologies to make your experience better, faster and safer, for advertising purposes and to allow us to continuously improve our sites, services, applications and tools. Any personal information or data collected by these technologies is used only by us or by our authorized service providers on our behalf.","CookiePolicy.p2.header":"\u003cstrong\u003eWhat are cookies, web beacons and similar technologies\u003c/strong\u003e","CookiePolicy.p2":"These technologies are essentially small data files placed on your computer, tablet, mobile phone or other device (â€œcollectively, a â€œdeviceâ€) that allows us to record information when you visit or interact with our websites, service, applications, messaging, and other tools. Though often these technologies are generically referred to as â€œCookies,â€ each functions slightly differently, and is better explained below:","CookiePolicy.p3":"\u003cstrong\u003eCookies:\u003c/strong\u003e Cookies are small (often encrypted) text files placed in the memory of your web browser or device when you visit a website or view a message. Cookies allow a website to recognize a particular device or browser. There are several types of cookies:","CookiePolicy.list1.item1":"Session cookies expire at the end of your browser session and allow us to link your actions during that particular browser session.","CookiePolicy.list1.item2":"Persistent cookies are stored on your device in between browser sessions, allowing us to remember your preferences or actions across multiple sites.","CookiePolicy.list1.item3":"First-party cookies are those set by a website that is being visited by the user at the time in order to preserve your settings (e.g., while on our site).","CookiePolicy.list1.item4":"Third-party cookies are placed in your browser by a website, or domain, that is not the website or domain that you are currently visiting. If a user visits a website and another entity sets a cookie through that website this would be a third-party cookie.","CookiePolicy.p4":"Cookies are used for a variety of purposes on our website. For example, they store information that allows us to present our site in your local language, or prices in local currency. They also communicate data to our servers when you visit our site, allowing you you to stay logged in to your account during your visit or maintain the site preferences you set. Preventing your browser from accepting 1st party cookies will prevent the placement of some cookies that are classified as â€œEssentialâ€.","CookiePolicy.p5":"\u003cstrong\u003eWeb beacons (pixels):\u003c/strong\u003e A web beacon (also called â€œtracking pixelsâ€ or â€œimage tagsâ€) is a small file (most often a transparent, 1x1 GIF file) that loaded on our web pages. These pixels may work in concert with cookies to collect information about your visit, your web browser/device, browsing activity, or onsite behavior and provide that information to service providers. Pixels are most commonly used to collect anonymous traffic metrics (page visits, button clicks, order completion) used to analyze site performance.","CookiePolicy.p6":"\u003cstrong\u003eScripts:\u003c/strong\u003e A script is a small piece of website code placed on our websites to power customer service tools like live chat, allow for the delivery of video tutorials in our help section, and allow us to provide interactive experiences to visitors. They are also used to collect data that we use for website analytics, or to provide data on the effectiveness of our advertising.","CookiePolicy.p7":"\u003cstrong\u003eSimilar technologies:\u003c/strong\u003e Technologies that store information in your browser or device utilizing local shared objects or local storage, such as HTML 5 cookies, and other web application software methods. These technologies can operate across all of your browsers. In some instances, these technologies may not be fully managed by your browser and may require management directly through your installed applications or device. We do not use these technologies for storing information to target advertising to you on or off our sites.","CookiePolicy.p8.header":"What technologies do we use and why","CookiePolicy.p8":"Our cookies, web beacons and similar technologies serve various purposes, but generally they (1) are necessary or essential to the functioning of our sites, services, applications, tools or messaging, (2) help us improve the performance of or provide you extra functionality of the same, (3) help us to serve relevant and targeted advertisements, or (4) allow us to offer support tools that you utilize to interact with our care guides:","CookiePolicy.p9":"\u003cstrong\u003eStrictly Necessary or Essential:\u003c/strong\u003e \"Strictly necessary\" or \"essential\" cookies, web beacons and similar technologies let you move around the website and use essential features like secure areas and shopping baskets. Without these technologies, services you have asked for cannot be provided. Please note that these technologies do not gather any information about you that could be used for marketing or remembering where you've been on the internet. Accepting these technologies is a condition of using our sites, services, applications, tools or messaging, so if you utilize tools that might prevent these from loading, we can't guarantee your use or how the security therein will perform during your visit.","CookiePolicy.p10":"\u003cstrong\u003ePerformance:\u003c/strong\u003e Performance technologies may include first or third-party cookies, web beacons/pixels, and scripts placed in order to gather information about how you use our website (pages you visit, if you experience any errors, load times). These cookies do not collect any information that could identify you and are only used to help us improve how our website works, understand the interests of our users, and measure how effective our content is by providing anonymous statistics and data regarding how our website is used.","CookiePolicy.p11":"\u003cstrong\u003eAdvertising:\u003c/strong\u003e Advertising technology may include first or third-party cookies, web beacons/pixels, and scripts placed in order to gather information on the effectiveness of our marketing efforts, deliver personalized content, or to generate data that allows for the delivery of advertising relevant to your specific interests on our sites, as well as third-party websites. We also utilize 3rd party service providers to assist us in delivering on the same functions, which means that our authorized service providers may also place cookies, web beacons and similar technologies on your device via our services (first and third party cookies). They may also collect information that helps them identify your device, such as IP address, or other unique or device identifiers.","CookiePolicy.p12":"\u003cstrong\u003eSupport:\u003c/strong\u003e Support technologies may include first or third-party cookies, web beacons / pixels, and scripts placed in order to provide tools for you to interact with our customer support teams. This technology allows us to provide chat services, gather customer feedback, and other tools used to support our visitors. Data collected for these purposes is never used for marketing or advertising purposes.","CookiePolicy.p13.header":"How to manage, control and delete these technologies","CookiePolicy.p13":"You may block cookies by activating the setting on your browser that allows you to refuse the setting of all or some cookies. However, if you use your browser settings to block all cookies (including essential cookies) it may limit your use of certain features or functions on our website or service. Unless you have adjusted your browser setting so that it will refuse cookies, our system will issue cookies as soon as you visit our site. Please note, as further described in our \u003ca\u003ePrivacy Policy\u003c/a\u003e, we currently do not alter our practices when we receive a â€œDo Not Trackâ€ signal from a visitorâ€™s browser.","CookiePolicy.p14":"Internet browsers allow you to change your cookie settings. These settings are usually found in the 'options' or 'preferences' menu of your internet browser. In order to understand these settings, the following links may be helpful. Otherwise you should use the 'Help' option in your internet browser for more details.","CookiePolicy.list2.item1":"\u003ca\u003eCookie settings in Internet Explorer\u003c/a\u003e","CookiePolicy.list2.item2":"\u003ca\u003eCookie settings in Firefox\u003c/a\u003e","CookiePolicy.list2.item3":"\u003ca\u003eCookie settings in Chrome\u0
